INSERT INTO `product` VALUES (1,'雀巢咖啡','固态','42条X13克','Q/QC0001S','6917878033662',NULL,10,NULL,376,5,3,4,'http://211.151.134.74:8080/portal/img/product/nescafe/nescafe1-1.jpg|http://211.151.134.74:8080/portal/img/product/nescafe/nescafe1-2.jpg|http://211.151.134.74:8080/portal/img/product/nescafe/nescafe1-3.jpg','雀巢公司陆续在中国的天津、青岛和东莞等地建起了自己的工厂，1999年秋天，雀巢成功地收购了太太乐集团80%的股份。之后，雀巢又于2001年与中国第二大鸡精生产厂家豪吉公司合作，成立了合资四川豪吉食品有限公司。\r\n雀巢在市场上咄咄逼人的态势，让它的竞争对手感到巨大的压力，国内一个乳制品企业的管理人员将雀巢形容为一个食品领域的“巨人”，随时都可以在相关的竞争领域发起攻势。','所有人群','植脂末[葡萄糖浆、食用氢化植物油、稳定剂（340ii、331iii、452i）、酪蛋白（含牛奶蛋白）、乳化剂、（471、472e）、食用香精、抗结剂（551）]、 白砂糖、速溶咖啡 、食品添加剂[（酸度调节剂（501i）、阿斯甜（含苯丙氨酸）]、食用香精。','010101','规格1--参数2','高蛋白',NULL);
INSERT INTO `product` VALUES (158,'280g辣三丁油辣椒','半固体','280g/瓶','GB/T20293','6921377400085',NULL,368,NULL,379,3,3,3,'http://211.151.134.74:8080/portal/img/product/lasandingyoulajiao/lasandingyoulajiao1.jpg|http://211.151.134.74:8080/portal/img/product/lasandingyoulajiao/lasandingyoulajiao2.jpg','选用高原猪肉丁，优质花生，豆腐丁而得名，采用秘传手艺精心制作，由于三种主料经油炸后酥脆爽口，嚼碎后在口中炸开，特别收消费者的喜爱。','嗜辣','植物油、花生、黄豆、辣椒、猪肉、芝麻、食盐、姜香辛料、食品添加剂（谷氨酸钠）','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (159,'维生素AD奶','液体','243mL/袋',NULL,NULL,NULL,367,NULL,377,5,5,5,'http://211.151.134.74:8080/portal/img/product/weishengsuADgainai/weishengsuADgainai1.jpg','含钙量远远高于一般牛奶，非常适合青少年、妇女、中年人以及其它缺钙的消费者饮用。由于它特别强化了促进钙的吸收的VD3因子，因此更容易被人体吸收。所以饮用海子高钙奶的效果一般会好于服用其它药物。与普通纯鲜奶相比，加钙纯鲜奶不仅强化了奶中可溶性生物活性钙，还增加了促进钙吸收的维生素D的含量。\r\n加钙纯鲜奶多为巴氏杀菌法处理过的袋装奶和盒装奶，可以更多地保留牛奶中的营养成分，最容易被人体消化吸收。','小孩、老年人及缺钙人群','牛奶','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (160,'国台1979','液体','500mL/瓶','DB52/526-2007','6927322001888',NULL,369,NULL,380,3,3,3,'http://211.151.134.74:8080/portal/img/product/guotai1979/guotai19791.jpg|http://211.151.134.74:8080/portal/img/product/guotai1979/guotai19792.jpg','尊贵的不只是美酒，更是对岁月的历练。国台1979源自茅台镇中国酱酒核心产区，出自酱香名师手笔，珍贵非凡。深红色窑变釉瓶体，辅以传统瓷器烤花工艺，器华于外，酒珍于内。品酌间，可感岁月之隽永，可品风云之激荡。','成人','高粱、小麦、水','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (161,'特选1号兰馨雀舌','固体','60g/盒','DB52/478-2005','6941315000986',NULL,370,NULL,381,3,3,3,'http://211.151.134.74:8080/portal/img/product/texuan1haolanqinqueshe/texuan1hao1.jpg|http://211.151.134.74:8080/portal/img/product/texuan1haolanqinqueshe/texuan1hao2.jp','俗称“极品”，公司标准称谓为“特选一号兰馨雀舌”，是兰馨雀舌系列中的稀有产品，产自兰馨公司自建的或组织专家认定授牌的“兰馨一号茶基地”（如：湄潭贡茶原产地的圣心山，湄潭高原春雪公司群峰有机茶基地）。此类基地面积小，每亩限产雀舌鲜叶10KG，产特选兰馨雀舌2KG，因此十分珍贵。','高要求群体','明前茶叶','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (162,'红油臭腐乳','半固体','260g/瓶','Q/WCY0003S',NULL,NULL,371,NULL,382,3,3,3,'http://211.151.134.74:8080/portal/img/product/hongyouchoudoufuru/hongyouchoudoufuru1.jpg|http://211.151.134.74:8080/portal/img/product/hongyouchoudoufuru/hongyouchoudoufuru2.jpg',' 红油腐乳是贵州的地方风味产品，产品是全自然的发酵过程，从外到里松软一致，富含蛋白质，口感一流。','3岁以上','大豆、水、大豆油、食盐、辣椒、花椒、白酒','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (163,'贵州腊肠','固体','400g/袋','Q/WFF0302','6928082800031',NULL,372,NULL,378,3,3,3,'http://211.151.134.74:8080/portal/img/product/guizhoulachang/guizhoulachang1.jpg|http://211.151.134.74:8080/portal/img/product/guizhoulachang/guizhoulachang2.jpg','　　黔五福贵州腊肠系选用贵州高原优质猪肉原料，经腌制、烘烤等传统加工工艺制作而成。该产品风味独特、腊香浓郁、爽口不腻、不加淀粉等低质辅料、营养卫生，可烧、烤、炒、蒸、煮后食用，口味自然纯正，但建议不采用微波炉来烤制食用，是居家食用、宴请宾客、馈赠亲友之佳品。','嗜辣','猪肉、白砂糖、白酒、食盐、味精、花椒、食品添加剂（亚硝酸钠）','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (164,'广味香肠','固体','400g/袋',NULL,'6928082800018',NULL,372,NULL,378,5,5,5,'http://211.151.134.74:8080/portal/img/product/guangweixiangchang/guangweixiangchang1.jpg|http://211.151.134.74:8080/portal/img/product/guangweixiangchang/guangweixiangchang2.jpg','将优质猪肉按肥瘦一定比例合理搭配，再经腌制、电加热烘烤等的工序加工而成。香甜为主味，不加淀粉等低质辅料。成品瘦肉呈红色、枣红色、脂肪呈乳白色、色泽分明，外表有光泽。  \r\n该品滋味鲜美，香甜可口，回味悠长，肉香味浓，肉质柔软嫩滑，是不可多得的美味佳肴，可烧、烤、炒、蒸、煮后食用，口味纯正，但建议不采用微波炉来烤制食用。该产品口感独特，长期以来深受消费者的喜爱， 是我公司销量第一的产品。','3岁以上人群，蒸熟后食用','猪肉、肠衣、白砂糖、食盐、白酒、味精，食品添加剂（双乙酸钠、D-异抗坏血酸钠、亚硝酸钠）','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (165,'老腊肉','固体','400g/袋',NULL,'6928082800049',NULL,372,NULL,378,5,5,5,'http://211.151.134.74:8080/portal/img/product/laolarou/laolarou1.jpg|http://211.151.134.74:8080/portal/img/product/laolarou/laolarou2.jpg','        老腊肉是将猪带皮后腿肉，按照合理的肥瘦搭配比例,根据规定的尺寸成型。经腌制，烘烤后的一种肉制品，以贵州民间传统的腊肉制作方法为基础，结合现代腌腊肉制品制作工艺、技术，在保持传统风味的基础上，减少烟熏的时间和强度，运用科学的方法将烟熏腊肉的烟熏危害降到最低。       \r\n        熏好的腊肉，表里一致，蒸熟切成片，透明发亮，色泽鲜艳，黄里透红，吃起来味道醇香，肥不腻口，瘦不塞牙，不仅风味独特，营养丰富，而且具有开胃、去寒、消食等功能。  \r\n        “贵州腊肉”是贵州各族人民从猎耕到机种，从原始到现代历经千百年的实践而研制出来的传统美食佳品。也是他们智慧的结晶。早已芳名远扬，被世人视为送礼、待客的佳品。','3岁以上人群，蒸熟后食用','猪肉、食盐、白酒、花椒，食品添加剂（双乙酸钠、D-异抗坏血酸钠、亚硝酸钠）','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (166,'猪肉小米鲊（甜味）','固体','400g/袋',NULL,'6928082800124',NULL,372,NULL,378,3,3,3,'http://211.151.134.74:8080/portal/img/product/zhurouxiaomizhatianwei/zhurouxiaomizha(tianwei)1.jpg|http://211.151.134.74:8080/portal/img/product/zhurouxiaomizhatianwei/zhurouxiaomizha(tianwei)2.jpg','猪肉小米鲊是精选贵州高原特有的糯小米为主料，辅以肥瘦相宜的新鲜猪肉、白砂糖，通过适当的蒸煮，在蒸煮熟化时猪肉与小米充分混合，猪肉中具有的脂肪芳香味道可以充分渗透到小米中去，使猪肉鲜香和小米的芳香溶为一体，产品风味独特，营养丰富，甜爽细腻，糯香可口，回味悠长。','3岁以上','小米、猪肉、白砂糖','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (167,'八宝小米鲊（甜味','固体','400g/袋',NULL,'6928082800131',NULL,372,NULL,378,3,3,3,'http://211.151.134.74:8080/portal/img/product/babaoxiaomizhatianwei/babaoxiaomizha(tianwei)1.jpg|http://211.151.134.74:8080/portal/img/product/babaoxiaomizhatianwei/babaoxiaomizha(tianwei)2.jpg','        秋冬时节，由于气候干燥，非常容易上火，所以这个季节适合吃一些粗粮和多纤维的食物。\r\n        本产品属纯天然珍品，口感绵甜，口味悠长，风味独特，色彩鲜黄透亮，颗粒圆润饱满，是一种营养价值很高的食品。\r\n黔五福小米鲊是以贵州高原生态环境下独有的贵州金黄糯小米为主要原料,配以核桃，花生，葵花子，红枣等，以贵州少数民族特有的糯竹蒸笼闷蒸而成,是贵州的\"十大名菜之一\"，是贵州特色饮食文化的典型代表。\r\n        从撕口初撕开外袋,直接将内袋放入沸水中，蒸或煮至产品软化,取出内袋装盘即可享用。','3岁以上','小米、高原植物油、核桃、花生、薏仁、莲子、百合、红枣','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (168,'贵州辣子鸡','固体','300g/袋',NULL,'6928082800865',NULL,372,NULL,378,3,3,3,'http://211.151.134.74:8080/portal/img/product/guizhoulaziji/guizhoulaziji1.jpg|http://211.151.134.74/img/product/guizhoulaziji/guizhoulaziji2.jpg|http://211.151.134.74/img/product/guizhoulaziji/guizhoulaziji3.jpg','        贵州一大怪“辣椒当作菜”。俗话说“四川人不怕辣,湖南人辣不怕,贵州人怕不辣”,贵州人吃辣椒的确令人瞠目结舌。 \r\n        辣子鸡可算是一道极有贵州特色的菜，是贵州的传统家常名菜，每逢佳节家家户户都会烧上一锅，全家人一起享用。那种香香的辣，滋味悠长而绵软，少去了川菜般的火爆，而添了一份贵州风情的自然与醇厚。这辣子鸡的辣不似寻常辣味，是辣中有香，辣而不过，让人吃一口还想吃第二口，直到满头大汗，欲罢不能。吃剩下的鸡肉下面条，足可余香三日。此菜色鲜红，辣香爽口，肉嫩离骨，皮糯鲜香，糍粑辣椒的特有味道更使其增色不少，实乃下饭佐酒的佳肴。','嗜辣','鸡、天然香料（辣椒、姜、大蒜等）','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (169,'蔬菜猪肉干（醇香味）','固体','180g/袋',NULL,'6928082801541',NULL,372,NULL,378,3,3,3,'http://211.151.134.74:8080/portal/img/product/shucaizhurouganchunxiangwei/shucaizhurougan(chunxiangwei)1.jpg|http://211.151.134.74:8080/portal/img/product/shucaizhurouganchunxiangwei/shucaizhurougan(chunxiangwei)2.jpg','采用优质猪肉为原料，在生产过程中加入纯天然新鲜蔬菜（汁），采用预煮、切丁、炒制、烘烤成熟等工艺反复调味、分层次入味加工而成，呈丝与颗粒混合状。  \r\n优质猪肉与新鲜蔬菜的完美结合，能补充蛋白质、维生素和膳食纤维，好吃不上火。既有肉香，又有蔬菜的香味，香气浓郁、回味悠长、营养丰富。  \r\n醇香味：咸鲜味为主，带微甜。','成人','猪肉、蜂蜜、大豆油、黄酒、酱油、辣椒、花椒、白糖、食盐、茴香','010101',NULL,'高蛋白',NULL);
INSERT INTO `product` VALUES (170,'精制猪肉脯（醇香味）','固体','200g/袋',NULL,'6928082800988',NULL,372,NULL,378,3,3,3,'http://211.151.134.74:8080/portal/img/product/jingzhizhuroupuchunxiangwei/jingzhizhuroupu(chunxiangwei)1.jpg|http://211.151.134.74:8080/portal/img/product/jingzhizhuroupuchunxiangwei/jingzhizhuroupu(chunxiangwei)2.jpg','        精选猪瘦肉为原料，将肉绞制到相当细后，用高级鱼露作为调味基础，再加以新鲜鸡蛋加工而成，品呈片状。该品味道鲜美、营养丰富，有独特可口的烧烤风味。机械化的自动包装，安全、卫生。（鱼露：一种以鱼、虾为原料，加入食盐发酵而成的调味酱汁，含有17种氨基酸，其中8种是人体所必需的。蛋白质含量也很丰富。）  \r\n        精制猪肉脯醇香味：口感香甜，猪肉纤维非常明显，独特的烧烤风味，回味悠长，口齿流香，主要体现猪肉的自然清香。','成人','猪瘦肉、白砂糖、鱼露、鸡蛋、食盐、香辛料','010101',NULL,'高蛋白',NULL);
