INSERT INTO `product` VALUES (224,'黄牛奶','液体','243ml/盒',NULL,NULL,NULL,367,NULL,377,5,5,5,'http://211.151.134.74:8080/portal/img/product/huangniunai/huangniunai.jpg','特别添加活性乳酸菌，除保留鲜牛奶的全部营养成分外，使多种维生素更易被人体吸收。不易发生腹胀，气多或腹泻现象，特别适合对乳糖消化不良的人群。特浓酸奶是“肠道清道夫”，是益生菌的丰富源泉。调节改善肠道微环境。1.2升大壶装，更实惠，能满足一家人一天的健康营养需求。','肠胃消化吸收不好的人',NULL,'010101',NULL,'',NULL);
